import React, {Component} from 'react'
import './style.css'

class Top extends Component{
  render(){
    return (
      <div className="top">
        <i className='quan'></i>
        <div className="input">
          <input type="text" placeholder='todo something'/>
        </div>
      </div>
    )
  }
}

export default Top
